import React from 'react';

import PopUpVacancy from "./PopUpVacancy";

const CardVacancy = ({
                         info,
                         title,
                         description
                     }) => {
    return (
        <PopUpVacancy
            info={info}
            title={title}
            description={description}
        />
    );
};

export {
    CardVacancy as default
};
